import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Header from './components/Form';
import PersonalDetails from './components/PersonalDetails';
import BussinessDetails from './components/BussinessDetails';
import LoanApplicationDetails from './components/LoanApplicationDetails'

const App = () => (
  <BrowserRouter>
    <div className="container">
      <Header />
      <Switch>
        <Route component={PersonalDetails} path="/" exact={true} />
        <Route component={BussinessDetails} path="/second" />
      </Switch>
    </div>
  </BrowserRouter>
);

export default App;
